import { Component } from 'react';

class Card extends Component {
    constructor() {
        super();
        this.state = {
            image: '',
            title: '',
            text: '',
        }
    }

    render () {
        return (
            <div>
                <div>{this.state.image}</div>
                <div>{this.state.title}</div>
                <div>{this.state.text}</div>
            </div>
        );
    }
}

export default Card;
